SELECT first_name
FROM patients
WHERE first_name LIKE 'C%';

select first_name, last_name
from patients
where weight between 100 and 120;

update patients
set allergies = 'NKA'
where allergies is null;

select count(patient_id) as birthCount
from patients
where year(birth_date) = 2010;

select *
from patients
where patient_id in (1,45,534,879,1000);

select *
from admissions
where admission_date = discharge_date;

select patient_id, count(patient_id) as totalAdmissions
from admissions
where patient_id = 579;

select distinct city
from patients
where province_id = 'NS';

select first_name, last_name, birth_date
from patients
where height > 160 and weight > 70;

select first_name, last_name, allergies
from patients
where city = 'Hamilton' and allergies is not null;

select distinct year(birth_date) as uniqueBirthYear
from patients
order by uniqueBirthYear ASC;

select first_name
from patients
order by len(first_name), first_name;

SELECT concat(upper(last_name),',',lower(first_name)) AS fullName
FROM patients
ORDER BY first_name DESC;

SELECT MAX(weight) - MIN(weight) AS diffWeight
FROM patients
WHERE last_name = 'Maroni';

select category_name, description
from categories
order by category_name;

select contact_name, address, city
from customers
where country not in ('Germany','Mexico', 'Spain');

select order_date, shipped_date, customer_id, freight
from orders
where order_date = '2018-02-26';

select employee_id, order_id, customer_id, required_date, shipped_date
from orders
where shipped_date > required_date;

select order_id
from orders
where order_id % 2 = 0;

select company_name, contact_name, fax
from customers
where fax is not null;
